import React from 'react';
import { FaTrash } from 'react-icons/fa';

const Order = ({ Good, onDelete }) => {
    // Проверка на существование объекта Good
    if (!Good) {
        return (
            <div className='item error'>
                <div className='line'></div>
                <p>Товар не найден</p>
            </div>
        );
    }

    return (
        <div className='item'>
            <div className='line'></div>
            {Good.img && (
                <img 
                    src={`./img/${Good.img}`} 
                    alt={Good.title || 'Товар'} 
                    onError={(e) => {
                        e.target.style.display = 'none';
                    }}
                />
            )}
            <div>
                <h1>{Good.title || 'Без названия'}</h1>
                <h2>{Good.price || 'Цена не указана'}</h2>
                <FaTrash 
                    className='delete_prod' 
                    onClick={() => onDelete(Good.id)} 
                />
            </div>
        </div>
    );
};

export default Order;
